import { useState, useEffect } from "react";
import axios from "axios";

const App = (props) => {
  const [playersList, setPlayersList] = useState([]);

  let players = [];

  useEffect(() => {
    async function getTeams() {
      axios.get("/getData").then((res) => {
        res.data.map((e) =>
          players.push({ name: e.player_name, manager: e.manager })
        );
        setPlayersList(players);
      });
    }
    getTeams();
  }, []);
  console.table(playersList);

  return (
    <div>
      <h2>Let's get started!</h2>
      <select id="ft-year-select">
        <option default value="#">
          Select a Team
        </option>
      </select>
      <select id="ft-team-select">
        <option default value="#">
          Select a Team
        </option>
      </select>
      <button>Click Me</button>
      <table>
        <thead>
          <tr>
            {playersList.map((e) => {
              <th>{e.manager}</th>;
            })}
          </tr>
        </thead>
      </table>
    </div>
  );
};

export default App;
